import React from "react";


function ReviewBox() {
  return (
    <div className="review-box">
      <div className="ratings"></div>
      <div className="review-info">
        <div className="review-movie-info">
          <img id="movie-poster" src="https://cdn.shopify.com/s/files/1/0057/3728/3618/products/b88f1213c01b76e6eb509b28deaf97c4_cf8616aa-04be-4ef0-800d-27d71437a89c_480x.progressive.jpg?v=1573595127" /></div>
        <p>Titanic(1997)</p>
        <div className="review-title">Review Title</div>
        <div className="review-content">Review Description</div>
      </div>
    </div>
  )
}

export default ReviewBox;
